Actionscript.script:
_root.效果("灰尘1",_parent._x,_parent._y,_parent._xscale);
_root.效果("灰尘1",_parent._x + 50,_parent._y,_parent._xscale);
_root.效果("灰尘1",_parent._x - 50,_parent._y,_parent._xscale);

_parent.死亡检测();

if (_parent.hp <= 0)
{
	if (_parent._name == _root.控制目标)
	{
		gotoAndStop(5);
	}
	stop();
}

onClipEvent (enterFrame) {
	if (_parent._parent.hp > 0 && _parent._parent._name == _root.控制目标 && _parent._parent.被动技能.裂地拳.启用)
	{
		// 按下攻击键J后触发：写法1
		if (Key.isDown(_parent._parent.A键))
		{
			_parent.受身反制 = true;
			_parent.gotoAndPlay("起身回旋踢");
		}
		// 按下跳跃键K后触发：写法2  
		if (_parent._parent.动作B)
		{
			//_parent._parent.状态改变("兵器跳");
			_parent.受身反制 = true;
			_parent.gotoAndPlay("起身回旋踢");
		}
	}
}

function 攻击时移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		if (Key.isDown(_root.右键) == true)
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (Key.isDown(_root.左键) == true)
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
}
function 攻击时按键四向移动(慢速度, 快速度)
{
	var 上下未按键 = 0;
	var 左右未按键 = 0;
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",快速度 / 2);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",快速度 / 2);
	}
	else
	{
		上下未按键 = 1;
	}
	if (Key.isDown(_parent.左键) == true)
	{
		_parent.移动("左",快速度);
	}
	else if (Key.isDown(_parent.右键) == true)
	{
		_parent.移动("右",快速度);
	}
	else
	{
		左右未按键 = 1;
	}
	if (上下未按键 && 左右未按键)
	{
		攻击时移动(慢速度,快速度);
	}
}
function 攻击时可改变移动方向(速度)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度);
	}
}
function 攻击时斜向移动(慢速度, 快速度)
{
	if (_parent.方向 == "右")
	{
		if (Key.isDown(_parent.右键) == true)
		{
			_parent.移动("右",快速度);
		}
		else
		{
			_parent.移动("右",慢速度);
		}
	}
	else if (_parent.方向 == "左")
	{
		if (Key.isDown(_parent.左键) == true)
		{
			_parent.移动("左",快速度);
		}
		else
		{
			_parent.移动("左",慢速度);
		}
	}
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",快速度);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",快速度);
	}
}
function 攻击时可斜向改变移动方向(速度)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度);
	}
	if (Key.isDown(_parent.上键) == true)
	{
		_parent.移动("上",速度 / 2);
	}
	else if (Key.isDown(_parent.下键) == true)
	{
		_parent.移动("下",速度 / 2);
	}
}
function 攻击时可斜向改变移动方向2(速度, 上下)
{
	if (Key.isDown(_parent.右键) == true)
	{
		_parent.方向改变("右");
	}
	else if (Key.isDown(_parent.左键) == true)
	{
		_parent.方向改变("左");
	}
	if (_parent.方向 == "右")
	{
		_parent.移动("右",速度 / 2);
	}
	else if (_parent.方向 == "左")
	{
		_parent.移动("左",速度 / 2);
	}
	if (上下 > 0)
	{
		_parent.移动("上",速度);
	}
	else if (上下 < 0)
	{
		_parent.移动("下",速度);
	}
}

onClipEvent (enterFrame) {
	if (_parent._parent._name == _root.控制目标)
	{
		if (_parent._parent.动作B || _parent._parent.动作A)
		{
			_parent.空手攻击搓招();
			_parent._parent.状态改变("空手战立");
			/*
			_parent.受身反制 = true;
			_parent.gotoAndPlay("空中受身反制刀");
			*/
		}
	}
}

onClipEvent(load){
	子弹属性 = _root.子弹属性初始化(this);

	//以下部分只需要更改需要更改的属性,其余部分可注释掉
	子弹属性.声音 = "";
	子弹属性.霰弹值 = 1;
	子弹属性.子弹散射度 = 0;
	子弹属性.子弹种类 = "近战子弹";
	子弹属性.子弹威力 =  _parent._parent.空手攻击力 * 2;
	if(_parent._parent.mp攻击加成){
		子弹属性.子弹威力 += _parent._parent.mp攻击加成;
	}
	子弹属性.子弹速度 = 0;
	子弹属性.Z轴攻击范围 = 35;
	子弹属性.击倒率 = 1;
	子弹属性.垂直击退速度 = 6;

	//非常用
	/*
	子弹属性.水平击退速度 = NaN;
	子弹属性.垂直击退速度 = NaN;
	子弹属性.发射效果 = "";
	子弹属性.击中地图效果 = "火花".
	子弹属性.击中后子弹的效果 = "".
	子弹属性.命中率 = NaN.
	子弹属性.固伤 = NaN;
	子弹属性.百分比伤害 = NaN;
	子弹属性.血量上限击溃 = NaN;
	子弹属性.防御粉碎 = NaN;
	*/
	子弹属性.区域定位area = this.area;
	/*
	//已初始化内容，通常不需要重复赋值，可注释掉
	子弹属性.发射者 = 子弹属性.发射者.
	子弹属性.shootX = 子弹属性.shootX;
	子弹属性.shootY = 子弹属性.shootY;
	子弹属性.shootZ = 子弹属性.shootZ;
	子弹属性.子弹敌我属性 = 子弹属性.子弹敌我属性;
	*/
	_root.子弹区域shoot传递(子弹属性);
}

